import "./App.css";
import Button from "./atoms/Button/Button";
import { ThemeProvider } from "theme-ui";
import { theme } from "./theme";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <div className="App">
        <Button sx={{backgroundColor: 'buttonBackground', color: 'buttonText'}}
          handleClick={(event) => {
            console.log("Clicked me");
          }}
        >
          Click me
        </Button>
      </div>
    </ThemeProvider>
  );
}

export default App;
